import React from 'react';
import CardList from './CardList';
import SearchBox from './SearchBox';
import { robots } from './robots';

const App = () => {
	return ( //remember we only need to return just one single parent so wrap around a div
		<div className = 'tc'>
			<h1> RoboFriends</h1>
			<SearchBox />
			<CardList robots = {robots}/>
		</div>
	);
}

export default App;
